["machine_introduction_109009"] = New("machine_introduction_109009","舒适的桌椅能让不开心的你迅速恢复状态！","This comfortable chair will get you relaxed in no time!","座り心地の良い椅子。挫けるあなたに元気をあげます！","舒適的桌椅能讓不開心的你迅速恢復狀態！","Dieser bequeme Stuhl wird dich im Handumdrehen entspannen!","Это удобное кресло поможет вам расслабиться в мгновение ока!","Ce fauteuil confortable vous permettra de vous détendre en un rien de temps !","Questa comoda sedia ti farà rilassare in pochissimo tempo!","¡Este cómodo sillón hará que te relajes en poco tiempo!","Esta confortável cadeira vai deixá-lo relaxado num instante!",""),
