["machine_introduction_112010"] = New("machine_introduction_112010","合适的水温和水流，让所有人爱上洗手。","You will be fascinated in washing your hands， thanks to its comfy water temperature and current.","ちょうど良い水温と水流。手洗うことを愛してしまいます。","合適的水溫和水流，讓所有人愛上洗手。","Dank der angenehmen Wassertemperatur und -strömung werden Sie beim Händewaschen fasziniert sein.","Вы будете увлечены мытьем рук, благодаря комфортной температуре воды и силе тока.","Vous serez fasciné en vous lavant les mains， grâce à sa température d'eau confortable et son courant.","Sarete affascinati nel lavarvi le mani, grazie alla sua confortevole temperatura dell'acqua e alla corrente.","Te fascinará lavarte las manos， gracias a su cómoda temperatura y corriente del agua.","Ficará fascinado em lavar o seu hands， graças à sua temperatura e corrente de água confortáveis.",""),
["machine_introduction_112013"] = New("machine_introduction_112013","特能装的置物架，能完美的收纳各种各样的杂物。","Enormous storage for all kinds of stuff.","たくさん入れられる棚。さまざまな物が入っています。","特能裝的置物架，能完美的收納各種各樣的雜物。","Enormer Stauraum für alle möglichen Dinge.","Огромное хранилище для любых вещей.","Un stockage énorme pour toutes sortes d'affaires.","Enorme deposito per tutti i tipi di cose.","Enorme almacenamiento para todo tipo de cosas.","Enorme armazenamento para todo o tipo de coisas.",""),
["machine_introduction_113001"] = New("machine_introduction_113001","俱乐部牌跑步机，让你拥有飞一般的感觉！","This running machine makes you feel you can fly!","クラブ専用のランニングマシン。あなたに飛ぶ感覚を！","俱樂部牌跑步機，讓你擁有飛一般的感覺！","Diese Laufmaschine gibt dir das Gefühl, dass du fliegen kannst!","Эта бегущая машина заставит вас почувствовать, что вы можете летать!","Cette machine à courir vous donne l'impression de pouvoir voler !","Questa macchina per correre ti fa sentire come se potessi volare!","¡Esta máquina de correr te hace sentir que puedes volar!","Esta máquina em funcionamento faz-lhe sentir que pode voar!",""),
["machine_introduction_113007"] = New("machine_introduction_113007","到哪里都能看见的贩卖机，能快速满足你小小的需求。","An ordinary vending machine that meets your tiny needs immediately!","どこでも見かける自販機。あなたの小さな贅沢を満足します！","到哪裡都能看見的販賣機，能快速滿足你小小的需求。","Ein gewöhnlicher Verkaufsautomat, der Ihre kleinen Bedürfnisse sofort erfüllt!","Обычный торговый автомат, который мгновенно удовлетворит ваши крошечные потребности!","Un distributeur automatique ordinaire qui répond immédiatement à vos petits besoins !","Un normale distributore automatico che soddisfa immediatamente i tuoi piccoli bisogni!","¡Una máquina expendedora ordinaria que satisface sus pequeñas necesidades de inmediato!","Uma máquina de venda automática vulgar que satisfaz imediatamente as suas pequenas necessidades!",""),
["machine_introduction_113009"] = New("machine_introduction_113009","舒适的桌椅能让不开心的你迅速恢复状态！","This comfortable chair will get you relaxed in no time!","座り心地の良い椅子。挫けるあなたに元気をあげます！","舒適的桌椅能讓不開心的你迅速恢復狀態！","Dieser bequeme Stuhl lässt dich im Handumdrehen entspannen!","Это удобное кресло поможет вам расслабиться в мгновение ока!","Ce fauteuil confortable te permettra de te détendre en un rien de temps !","Questa comoda sedia ti farà rilassare in un attimo!","¡Este cómodo sillón hará que te relajes en un abrir y cerrar de ojos!","Esta confortável cadeira vai deixá-lo relaxado num instante!",""),
["machine_introduction_113011"] = New("machine_introduction_113011","饮水机无限量供应无菌水，运动之余别忘记多喝水哟！","Unlimited pure water supply. Always drink water after exercising!","無料で飲料水を提供します。運動するときに水を飲むのを忘れずにね！","飲水機無限量供應無菌水，運動之餘別忘記多喝水喲！","Unbegrenzte Versorgung mit reinem Wasser. Trinken Sie immer Wasser nach dem Training!","Неограниченный запас чистой воды. Всегда пейте воду после тренировки!","Un approvisionnement illimité en eau pure. Buvez toujours de l'eau après avoir fait de l'exercice !","Fornitura illimitata di acqua pura. Bevi sempre acqua dopo l'esercizio!","Suministro ilimitado de agua pura. ¡Bebe siempre agua después de hacer ejercicio!","Fornecimento de água pura sem limites. Beba sempre água depois de se exercitar!",""),
["machine_introduction_113013"] = New("machine_introduction_113013","有了大显示屏，壮丽动人的画面带给你至高的享受。","Large in size， huge in visual impact!","大きなモニターが絶そうな画面を楽しませてくれます。","有了大顯示屏，壯麗動人的畫面帶給你至高的享受。","Groß in der Größe, riesig in der optischen Wirkung!","Большой размер, огромный визуальный эффект!","Grande par la taille， énorme par l'impact visuel !","Grande nelle dimensioni, enorme nell'impatto visivo!","¡Grande en tamaño, enorme en impacto visual!","Grande em size， enorme em impacto visual!",""),
["machine_introduction_113014"] = New("machine_introduction_113014","小小的装饰是整个房间的点睛之笔。","This small decoration is the focus of the entire room.","小さな飾りがこの部屋の目になっています。","小小的裝飾是整個房間的點睛之筆。","Diese kleine Dekoration ist der Mittelpunkt des gesamten Raumes.","Это небольшое украшение является центром внимания всей комнаты.","Cette petite décoration est le point de mire de toute la pièce.","Questa piccola decorazione è il fulcro di tutta la stanza.","Esta pequeña decoración es el centro de atención de toda la sala.","Esta pequena decoração é o foco de toda a sala.",""),
["machine_introduction_114001"] = New("machine_introduction_114001","球员们放松的酒吧，比赛胜利后的一杯酒永远最美味！","A bar for players to relax. A drink after a victory is always the best!","選手たちがリラックスするバー。試合勝利後の一杯が一番美味いです！","球員們放鬆的酒吧，比賽勝利後的一杯酒永遠最美味！","Eine Bar für die Spieler zum Entspannen. Ein Drink nach einem Sieg ist immer das Beste!","Бар для игроков, чтобы расслабиться. Выпить после победы - это всегда лучше всего!","Un bar pour que les joueurs puissent se détendre. Un verre après une victoire est toujours le meilleur !","Un bar per il relax dei giocatori. Un drink dopo una vittoria è sempre il massimo!","Un bar para que los jugadores se relajen. ¡Una bebida después de una victoria es siempre lo mejor!","Um bar para os jogadores relaxarem. Uma bebida depois de uma vitória é sempre o melhor!",""),
["machine_introduction_114002"] = New("machine_introduction_114002","没有人能抗拒柔软舒适的座椅吧？","Is there anyone who can refuse a soft cozy chair?","柔らかくて気持ち良い椅子を拒む人などいないでしょう。","沒有人能抗拒柔軟舒適的座椅吧？","Gibt es jemanden, der einen weichen, gemütlichen Stuhl ablehnen kann?","Разве кто-то может отказаться от мягкого уютного кресла?","Y a-t-il quelqu'un qui puisse refuser une chaise douce et confortable ?","C'è qualcuno che può rifiutare una sedia morbida e accogliente?","¿Hay alguien que pueda rechazar una silla suave y acogedora?","Haverá alguém que possa recusar uma cadeira suave e acolhedora?",""),
["machine_introduction_114004"] = New("machine_introduction_114004","打完比赛之后也能有些其他娱乐","There are also other types of entertainment after a game.","試合の後にエンターテインメントでもできます。","打完比賽之後也能有些其他娛樂","Es gibt auch andere Arten der Unterhaltung nach einem Spiel.","Есть и другие виды развлечений после игры.","Il existe également d'autres types de divertissement après une partie.","Ci sono anche altri tipi di intrattenimento dopo una partita.","También hay otros tipos de entretenimiento después de una partida.","Há também outros tipos de entretenimento depois de um jogo.",""),
["machine_introduction_114005"] = New("machine_introduction_114005","给厨师提供大显身手的舞台。","A stage for cooks to show themselves.","コックに才能を発揮させる舞台です。","給廚師提供大顯身手的舞台。","Eine Bühne, auf der sich die Köche präsentieren können.","Сцена для поваров, чтобы показать себя.","Une scène pour que les cuisiniers puissent se montrer.","Un palcoscenico per i cuochi per mostrarsi.","Un escenario para que los cocineros se muestren.","Um palco para os cozinheiros se mostrarem.",""),
["machine_introduction_114006"] = New("machine_introduction_114006","我们是因为低调，才不去评选米其林星级的。","We won’t go for Michelin stars， because we want to keep a low profile.","控えめにしたいからミシュラン評定に参加しませんでした。","我們是因為低調，才不去評選米其林星級的。","Wir wollen keine Michelin-Sterne, denn wir wollen uns zurückhalten.","Мы не будем стремиться к мишленовским звездам, потому что хотим оставаться на виду.","Nous n'irons pas chercher des étoiles Michelin， car nous voulons garder un profil bas.","Non vogliamo le stelle Michelin, perché vogliamo mantenere un profilo basso.","No iremos a por las estrellas Michelin， porque queremos pasar desapercibidos.","Não iremos pela Michelin stars， porque queremos manter um perfil discreto.",""),
["machine_introduction_114007"] = New("machine_introduction_114007","好酒虽好，可不要贪杯哟！","Enjoy the tasty wine， but not too much!","酒が美味いけど飲み過ぎないようにご注意！","好酒雖好，可不要貪杯喲！","Genießen Sie den leckeren Wein, aber nicht zu viel!","Наслаждайтесь вкусным вином, но не слишком много!","Profitez du vin savoureux， mais pas trop !","Godetevi il vino saporito, ma non troppo!","Disfruta del sabroso vino， ¡pero no demasiado!","Desfrute do saboroso wine， mas não demasiado!",""),
["machine_introduction_114008"] = New("machine_introduction_114008","这可是百年老字号。","A time-tested brand in the business.","百年の老舗です。","這可是百年老字號。","Eine altbewährte Marke in der Branche.","Проверенный временем бренд в бизнесе.","Une marque qui a fait ses preuves dans le métier.","Un marchio collaudato nel settore.","Una marca probada en el tiempo en el negocio.","Uma marca testada ao longo do tempo no ramo.",""),
["machine_introduction_115001"] = New("machine_introduction_115001","每次开会的时候都有种圆桌会议的感觉...","I miss King Arthur every time we have a meeting here.","毎度会議するときに、アーサーキングを思い出します。","每次開會的時候都有種圓桌會議的感覺...","Ich vermisse King Arthur jedes Mal, wenn wir hier ein Treffen haben.","Я скучаю по королю Артуру каждый раз, когда мы проводим здесь встречу.","Le Roi Arthur me manque à chaque fois que nous avons une réunion ici.","Mi manca Re Artù ogni volta che abbiamo una riunione qui.","Echo de menos al Rey Arturo cada vez que tenemos una reunión aquí.","Sinto falta do Rei Artur sempre que temos uma reunião aqui.",""),
["machine_introduction_115002"] = New("machine_introduction_115002","教练说这是顶配电脑...带动顶配游戏应该没问题吧！","The coach said it’s a high-end desktop. Surely I can use it to play my favorite video games， right?","トップスペックのPCだと言われていますが、次世代ゲームをやるのは問題ないでしょう！","教練說這是頂配電腦...帶動頂配遊戲應該沒問題吧！","Der Trainer sagte, es sei ein High-End-Desktop. Sicherlich kann ich damit meine Lieblingsvideospiele spielen, oder?","Тренер сказал, что это высококлассный настольный компьютер. Конечно, я смогу играть на нем в свои любимые видеоигры, верно?","Le coach a dit que c'était un ordinateur de bureau haut de gamme. Je peux sûrement l'utiliser pour jouer à mes jeux vidéo préférés, non ?","L'allenatore ha detto che è un desktop di fascia alta. Sicuramente posso usarlo per giocare ai miei videogiochi preferiti, giusto?","El entrenador dijo que es un ordenador de sobremesa de gama alta. Seguro que puedo usarlo para jugar a mis videojuegos favoritos， ¿no?","O treinador disse que é um computador de secretária de topo de gama. Certamente que posso usá-lo para reproduzir o meu vídeo favorito games，, certo?",""),
