["machine_introduction_115006"] = New("machine_introduction_115006","4K高清投影仪，观看战斗回放的时候甚至可以看清球场上飞过的小飞虫！","A 4K high-resolution projector. You can even see a bug flying over the field when watching a replay!","4Kハイレゾプロジェクター。試合見ると飛ぶ虫の顔もはっきり見えます。","4K高清投影儀，觀看戰鬥回放的時候甚至可以看清球場上飛過的小飛蟲！","Ein hochauflösender 4K-Projektor. Man kann sogar einen Käfer über das Spielfeld fliegen sehen, wenn man sich eine Wiederholung ansieht!","Проектор с высоким разрешением 4K. При просмотре повтора можно увидеть даже жука, пролетающего над полем!","Un projecteur haute résolution 4K. Vous pouvez même voir un insecte voler au-dessus du terrain en regardant un replay !","Un proiettore 4K ad alta risoluzione. Puoi persino vedere un insetto che vola sul campo quando guardi un replay!","Un proyector de alta resolución 4K. ¡Incluso puedes ver un bicho volando sobre el campo cuando ves una repetición!","Um projector de alta resolução de 4K. Até se pode ver um insecto a sobrevoar o campo quando se vê um replay!",""),
