["machine_introduction_120108"] = New("machine_introduction_120108","高清的大屏，坐在观众席最后一排也能看清比赛细节！","A high-resolution screen. Even the audience sitting in the last row of the stand can see all the details clearly!","ハイレゾで巨大なスクリーン。観衆席の最後列でも試合のディテールをうまく見えます！","高清的大屏，坐在觀眾席最後一排也能看清比賽細節！","Ein hochauflösender Bildschirm. Selbst die Zuschauer in der letzten Reihe der Tribüne können alle Details deutlich sehen!","Экран с высоким разрешением. Даже зрители, сидящие на последнем ряду трибуны, могут четко видеть все детали!","Un écran haute résolution. Même le public assis au dernier rang de la tribune peut voir clairement tous les détails !","Uno schermo ad alta risoluzione. Anche il pubblico seduto nell'ultima fila della tribuna può vedere chiaramente tutti i dettagli!","Una pantalla de alta resolución. ¡Incluso el público sentado en la última fila de la grada puede ver todos los detalles con claridad!","Um ecrã de alta resolução. Até a audiência sentada na última fila da bancada pode ver claramente todos os detalhes!",""),
["machine_introduction_120201"] = New("machine_introduction_120201","扇形的棒球专用球场，是棒球协会认可的比赛场地。","A cone-shaped playground， authorized by the Association.","扇形の標準フィールドです。野球協会認証済み。","扇形的棒球專用球場，是棒球協會認可的比賽場地。","Ein kegelförmiger Spielplatz, der vom Verband genehmigt wurde.","Игровая площадка в форме конуса, разрешенная Ассоциацией.","Un terrain de jeu en forme de cône， autorisé par l'Association.","Un campo da gioco a forma di cono, autorizzato dall'Associazione.","Un campo de juego en forma de cono， autorizado por la Asociación.","Um cone-shaped playground， autorizado pela Associação.",""),
["machine_introduction_120202"] = New("machine_introduction_120202","观众们看比赛的地方，最热闹也是最混乱的地方。","The very noisy and chaotic place for the audience to watch the game.","観衆が座るところ。一番賑やかな場所。","觀眾們看比賽的地方，最熱鬧也是最混亂的地方。","Ein sehr lauter und chaotischer Ort für die Zuschauer, um das Spiel zu verfolgen.","Очень шумное и хаотичное место для зрителей, наблюдающих за игрой.","L'endroit très bruyant et chaotique où le public peut regarder le match.","Un luogo molto rumoroso e caotico per il pubblico che assiste alla partita.","Un lugar muy ruidoso y caótico para que el público vea el partido.","O lugar muito barulhento e caótico para a audiência assistir ao jogo.",""),
["machine_introduction_120205"] = New("machine_introduction_120205","比赛得分的记录板，比赛的起伏结果都显示在上面。","This scoreboard allows you to check the latest results.","得点スコアを表示する板。試合のメリハリを記録しています。","比賽得分的記錄板，比賽的起伏結果都顯示在上面。","Diese Anzeigetafel ermöglicht es Ihnen, die letzten Ergebnisse zu überprüfen.","На этом табло можно узнать последние результаты.","Ce tableau d'affichage vous permet de vérifier les derniers résultats.","Questo tabellone permette di controllare gli ultimi risultati.","Este marcador permite comprobar los últimos resultados.","Este painel de pontuação permite verificar os últimos resultados.",""),
["machine_introduction_120206"] = New("machine_introduction_120206","防止球飞出场外甚至伤害到观众的保险措施。","A security measure to prevent the ball from flying off the field or even hurting the audience.","飛び出すボールを防ぐ安全措置。","防止球飛出場外甚至傷害到觀眾的保險措施。","Eine Sicherheitsmaßnahme, um zu verhindern, dass der Ball vom Spielfeld fliegt oder gar die Zuschauer verletzt.","Мера безопасности, предотвращающая вылет мяча за пределы поля или даже травмирование зрителей.","Une mesure de sécurité pour éviter que le ballon ne s'envole du terrain ou même ne blesse le public.","Una misura di sicurezza per evitare che la palla voli fuori dal campo o che faccia male al pubblico.","Una medida de seguridad para evitar que el balón salga volando del campo o incluso que haga daño al público.","Uma medida de segurança para evitar que a bola voe para fora do campo ou mesmo que prejudique a audiência.",""),
