["machine_introduction_125011"] = New("machine_introduction_125011","地下停车场安全凉快，只是收费高一点点。","A safe and cool underground parking lot， although its charge is slightly higher.","地下駐車場が涼しいけど料金がやや高め。","地下停車場安全涼快，只是收費高一點點。","Ein sicherer und kühler Tiefgaragenplatz, der allerdings etwas teurer ist.","Безопасная и прохладная подземная парковка, хотя плата за нее немного выше.","Un parking souterrain sûr et frais， bien que son prix soit légèrement plus élevé.","Un parcheggio sotterraneo sicuro e fresco, anche se il costo è leggermente più alto.","Un aparcamiento subterráneo seguro y fresco, aunque su coste es ligeramente superior.","Um parque de estacionamento subterrâneo seguro e fresco lot， embora a sua carga seja ligeiramente superior.",""),
["machine_introduction_126001"] = New("machine_introduction_126001","清凉的能量饮料等待着你带走","Want some refreshing energy drink? Get it now!","清涼なエネルギー飲料が待っています。","清涼的能量飲料等待著你帶走","Willst du einen erfrischenden Energydrink? Holen Sie es jetzt!","Хотите освежающий энергетический напиток? Получите его прямо сейчас!","Vous voulez une boisson énergétique rafraîchissante ? Achetez-la maintenant !","Vuoi una bevanda energetica rinfrescante? Prendila ora!","¿Quieres una bebida energética refrescante? ¡Consíguela ahora!","Quer uma bebida energética refrescante? Adquira-o agora!",""),
["machine_introduction_126002"] = New("machine_introduction_126002","买定离手的地方，马上带你心怡的棒球装备回家","Place your bit and bring your favorite baseball gear home today!","お気に入りの装備を買えます。","買定離手的地方，馬上帶你心怡的棒球裝備回家","Platzieren Sie Ihr Bit und bringen Sie Ihre Lieblings-Baseball-Ausrüstung noch heute nach Hause!","Разместите свой бит и привезите любимую бейсбольную экипировку домой сегодня!","Placez votre bit et ramenez votre équipement de baseball préféré à la maison aujourd'hui !","Posiziona la tua punta e porta a casa la tua attrezzatura da baseball preferita oggi stesso!","Coloca tu bit y llévate tu equipo de béisbol favorito a casa hoy mismo.","Coloque a sua parte e traga o seu equipamento de basebol favorito para casa hoje mesmo!",""),
["machine_introduction_126003"] = New("machine_introduction_126003","滴滴——嘟嘟，它总是这么说","“Beep... beep... beep...” It repeats itself every day.","ピッピピッピ。いつもこのセリフです。","滴滴——嘟嘟，它總是這麼說","Beep... beep... beep... Es wiederholt sich jeden Tag.","Бип... бип... бип... бип... Это повторяется каждый день.","Bip... bip... bip... Cela se répète tous les jours.","Bip... bip... bip... Si ripete ogni giorno.","Bip... bip... bip... Se repite cada día.","Bip... bip... bip... Repete-se todos os dias.",""),
["machine_introduction_126004"] = New("machine_introduction_126004","春天会开花的盆栽，但是这么多年过去了还是没有见过它开花","A potted plant that is supposed to bloom in spring， but nobody has seen it bloom all these years.","春になったら開花する盆栽だと言われていますが、花咲いたのを一度も見たことありません。","春天會開花的盆栽，但是這麼多年過去了還是沒有見過它開花","Eine Topfpflanze, die im Frühling blühen soll, aber niemand hat sie all die Jahre blühen sehen.","Горшечное растение, которое должно зацвести весной, но никто не видел его цветения все эти годы.","Une plante en pot qui est censée fleurir au printemps， mais personne ne l'a vue fleurir pendant toutes ces années.","Una pianta in vaso che dovrebbe fiorire in primavera, ma nessuno l'ha vista fiorire in tutti questi anni.","Una planta en maceta que se supone que florece en primavera， pero nadie la ha visto florecer en todos estos años.","Uma planta em vaso que é suposto florescer em spring， mas ninguém a viu florescer durante todos estes anos.",""),
["machine_introduction_126005"] = New("machine_introduction_126005","一台看似平平无奇的机器，但是有着强大的制作功能","A plain-looking yet extremely useful machine.","一見普通そうな機械ですが、強い製造機能を持っているようです。","一台看似平平無奇的機器，但是有著強大的製作功能","Eine einfach aussehende, aber äußerst nützliche Maschine.","Простая на вид, но чрезвычайно полезная машина.","Une machine d'apparence ordinaire mais extrêmement utile.","Una macchina dall'aspetto semplice ma estremamente utile.","Una máquina de aspecto sencillo pero extremadamente útil.","Uma máquina de aspecto simples mas extremamente útil.",""),
