["machine_introduction_127001"] = New("machine_introduction_127001","走过路过不要错过！最新款的装备了解一下？","Hey! Take a look at these brand-new stuff! You will like them!","最新型の装備です。入ってご覧なさい！","走過路過不要錯過！最新款的裝備了解一下？","Hey! Sieh dir diese brandneuen Sachen an! Sie werden dir gefallen!","Эй! Взгляните на эти совершенно новые вещи! Они тебе понравятся!","Hé ! Regarde ces trucs tout neufs ! Tu vas les aimer !","Ehi, date un'occhiata a queste cose nuove di zecca! Ti piaceranno!","¡Eh! ¡Echa un vistazo a estas cosas nuevas! ¡Te van a gustar!","Dêem uma vista de olhos a estas coisas novinhas em folha! Vai gostar delas!",""),
["machine_introduction_127002"] = New("machine_introduction_127002","不是你选择了球棒，而是球棒选择了你","You didn’t choose the bat， but the bat chose you.","あなたがバットを選んだではなく、バットがあなたを選びました。","不是你選擇了球棒，而是球棒選擇了你","Du hast nicht die Fledermaus gewählt, sondern die Fledermaus hat dich gewählt.","Не ты выбрал летучую мышь, а летучая мышь выбрала тебя.","Tu n'as pas choisi la chauve-souris, mais c'est la chauve-souris qui t'a choisi.","Non sei stato tu a scegliere il pipistrello, ma il pipistrello ha scelto te.","Tú no elegiste al murciélago， pero el murciélago te eligió a ti.","Não escolheu o bat， mas o taco escolheu-o a si.",""),
