["machine_introduction_132001"] = New("machine_introduction_132001","大汗淋漓之后没有比洗澡更爽的事情了！","The only thing you need after sweating up is a shower!","汗掻いた後のお風呂より気持ちいいことがありません！","大汗淋漓之後沒有比洗澡更爽的事情了！","Das Einzige, was man nach dem Schwitzen braucht, ist eine Dusche!","Единственное, что вам нужно после того, как вы вспотели - это душ!","La seule chose dont vous avez besoin après avoir transpiré est une douche !","L'unica cosa di cui hai bisogno dopo aver sudato è una doccia!","¡Lo único que necesitas después de sudar es una ducha!","A única coisa de que se precisa depois de suar é de um duche!",""),
["machine_introduction_132006"] = New("machine_introduction_132006","贴合人体工程学的马桶，体验感极佳。","An ergonomic toilet that provides excellent user experience.","人間工学で設計されたトイレ。忘れられない体験を。","貼合人體工程學的馬桶，體驗感極佳。","Eine ergonomische Toilette, die ein hervorragendes Benutzererlebnis bietet.","Эргономичный унитаз, обеспечивающий превосходное удобство пользования.","Des toilettes ergonomiques qui offrent une excellente expérience utilisateur.","Una toilette ergonomica che offre un'eccellente esperienza d'uso.","Un inodoro ergonómico que proporciona una excelente experiencia de uso.","Uma sanita ergonómica que proporcione uma excelente experiência de utilização.",""),
["machine_introduction_132010"] = New("machine_introduction_132010","合适的水温和水流，让所有人爱上洗手。","You will be fascinated in washing your hands， thanks to its comfy water temperature and current.","ちょうど良い水温と水流。手洗うことを愛してしまいます。","合適的水溫和水流，讓所有人愛上洗手。","Dank der angenehmen Wassertemperatur und -strömung werden Sie beim Waschen Ihrer Hände fasziniert sein.","Вы будете в восторге от мытья рук, благодаря комфортной температуре воды и силе тока.","Vous serez fasciné en vous lavant les mains， grâce à sa température d'eau et son courant confortables.","Sarete affascinati nel lavarvi le mani, grazie alla sua confortevole temperatura dell'acqua e alla corrente.","Te fascinará lavarte las manos， gracias a su cómoda temperatura y corriente del agua.","Ficará fascinado em lavar o seu hands， graças à sua temperatura e corrente de água confortáveis.",""),
["machine_introduction_132013"] = New("machine_introduction_132013","特能装的置物架，能完美的收纳各种各样的杂物。","Enormous storage for all kinds of stuff.","たくさん入れられる棚。さまざまな物が入っています。","特能裝的置物架，能完美的收納各種各樣的雜物。","Enormer Stauraum für alle möglichen Dinge.","Огромное хранилище для любых вещей.","Un énorme rangement pour toutes sortes d'affaires.","Enorme deposito per tutti i tipi di cose.","Enorme almacenamiento para todo tipo de cosas.","Enorme armazenamento para todo o tipo de coisas.",""),
["machine_introduction_133001"] = New("machine_introduction_133001","让你拥有可以把棒球打出太阳系的力量！","Allows you to strike a baseball out of the solar system!","ボールを太陽系の外へ打てる力を！","讓你擁有可以把棒球打出太陽系的力量！","Erlaubt es dir, einen Baseball aus dem Sonnensystem zu schlagen!","Позволяет выбить бейсбольный мяч из Солнечной системы!","Permet de frapper une balle de baseball hors du système solaire !","Ti permette di colpire una palla da baseball fuori dal sistema solare!","¡Permite sacar una pelota de béisbol del sistema solar!","Permite-lhe bater uma bola de basebol fora do sistema solar!",""),
["machine_introduction_133007"] = New("machine_introduction_133007","到哪里都能看见的贩卖机，能快速满足你小小的需求。","An ordinary vending machine that meets your tiny needs immediately!","どこでも見かける自販機。あなたの小さな贅沢を満足します！","到哪裡都能看見的販賣機，能快速滿足你小小的需求。","Ein gewöhnlicher Verkaufsautomat, der deine kleinen Bedürfnisse sofort befriedigt!","Обычный торговый автомат, мгновенно удовлетворяющий ваши крошечные потребности!","Un distributeur automatique ordinaire qui répond immédiatement à vos petits besoins !","Un normale distributore automatico che soddisfa immediatamente i tuoi piccoli bisogni!","¡Una máquina expendedora ordinaria que satisface tus pequeñas necesidades de forma inmediata!","Uma máquina de venda automática vulgar que satisfaz imediatamente as suas pequenas necessidades!",""),
["machine_introduction_133009"] = New("machine_introduction_133009","舒适的桌椅能让不开心的你迅速恢复状态！","This comfortable chair will get you relaxed in no time!","座り心地の良い椅子。挫けるあなたに元気をあげます！","舒適的桌椅能讓不開心的你迅速恢復狀態！","Dieser bequeme Sessel lässt dich im Handumdrehen entspannen!","Это удобное кресло поможет вам расслабиться в мгновение ока!","Ce fauteuil confortable vous permettra de vous détendre en un rien de temps !","Questa comoda sedia ti farà rilassare in pochissimo tempo!","¡Este cómodo sillón hará que te relajes en un abrir y cerrar de ojos!","Esta confortável cadeira vai deixá-lo relaxado num instante!",""),
["machine_introduction_133011"] = New("machine_introduction_133011","饮水机无限量供应无菌水，运动之余别忘记多喝水哟！","Unlimited pure water supply. Always drink water after exercising!","無料で飲料水を提供します。運動するときに水を飲むのを忘れずにね！","飲水機無限量供應無菌水，運動之餘別忘記多喝水喲！","Unbegrenzte Versorgung mit reinem Wasser. Trinken Sie nach dem Sport immer Wasser!","Неограниченный запас чистой воды. Всегда пейте воду после тренировки!","Un approvisionnement illimité en eau pure. Buvez toujours de l'eau après avoir fait de l'exercice !","Una fornitura illimitata di acqua pura. Bevi sempre acqua dopo l'allenamento!","Suministro ilimitado de agua pura. ¡Bebe siempre agua después de hacer ejercicio!","Fornecimento de água pura sem limites. Beba sempre água depois de se exercitar!",""),
